import React, { Component } from "react";
import Talent from "./Talent";

export default class TalentTable extends Component {
  getTalentsForHero = () => {};

  render() {
    const AbathurHero = this.props.heroes.filter(
      hero => hero.name === "Abathur"
    );
    console.log(AbathurHero);
    return (
      <div className="container">
        <table className="table">
          <thead>
            <tr>
              <th scope="col">Level</th>
              <th scope="col">Name</th>
              <th scope="col">TalentName</th>
            </tr>
          </thead>
          <tbody />
        </table>

        {AbathurHero.talents.map(talent => (
          <Talent talent={talent} />
        ))}
        {/* {this.props.heroes.map(hero =>
          hero.talents.map(talent => <Talent talent={talent} />)
        )} */}
        <button
          type="button"
          className="btn btn-primary"
          onClick={this.props.onRandomButton}
        >
          Start
        </button>
      </div>
    );
  }
}
